// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './styles/index.css';

// ÂØºÂÖ•È°µÈù¢ÁªÑ‰ª∂
import Login from './pages/Auth/Login';
import PINDashboard from './pages/PIN/Dashboard';
import CSRSearch from './pages/CSR/Search_new';
import AdminDashboard from './pages/Admin/Dashboard_new';
import { CSRShortlist, CSRHistory, CategoryManagement, Reports } from './components/SimpleComponents';

// ÁÆÄÂçïÁöÑPINÂéÜÂè≤ÁªÑ‰ª∂
const PINHistory = () => {
  const { user } = useAuth();
  return (
    <div className="page-container">
      <Navbar userType="pin" user={user} />
      <div className="main-content">
        <div className="dashboard">
          <h1 className="dashboard-title">ÂéÜÂè≤ËÆ∞ÂΩï</h1>
          <div className="card">
            <div className="card-body">
              <div className="empty-state">
                <div className="empty-state-icon">üìã</div>
                <div className="empty-state-title">ÂéÜÂè≤ËÆ∞ÂΩïÂäüËÉΩ</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="app">
          <Routes>
            {/* ÂÖ¨ÂÖ±Ë∑ØÁî± */}
            <Route path="/login" element={<Login />} />
            
            {/* PINÁî®Êà∑Ë∑ØÁî± */}
            <Route path="/pin/dashboard" element={<PINDashboard />} />
            <Route path="/pin/history" element={<PINHistory />} />
            
            {/* CSR‰ª£Ë°®Ë∑ØÁî± */}
            <Route path="/csr/search" element={<CSRSearch />} />
            <Route path="/csr/shortlist" element={<CSRShortlist />} />
            <Route path="/csr/history" element={<CSRHistory />} />
            
            {/* ÁÆ°ÁêÜÂëòË∑ØÁî± */}
            <Route path="/admin/dashboard" element={<AdminDashboard />} />
            <Route path="/admin/categories" element={<CategoryManagement />} />
            <Route path="/admin/reports" element={<Reports />} />
            
            {/* ÈªòËÆ§ÈáçÂÆöÂêëÂà∞ÁôªÂΩïÈ°µ */}
            <Route path="/" element={<Navigate to="/login" replace />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
